	add("fruitarian", "{\"term\":\"fruitarian\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|fruit|arian|lang\u003den}}. First attested circa 1890.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A variant of vegetarian who intends to be limited to eating only such parts of plants whose consumption does not kill the plant (such as fruits, vegetables that can be compared to fruit, nuts and grain, but not for example tubers). The purest \u0027\u0027fruitarians\u0027\u0027 do not want to destroy even the seeds\", \"priority\":1}]}, \"synonyms\":{}}");

